    { id: "e3", title: "Beer", amount: 20, date: new Date(2022, 4, 5) },
    { id: "e4", title: "Keyboard", amount: 99, date: new Date(2022, 2, 4) },
  ];

  return (
    <div>
      <ExpenseItem title={expenses[2].title}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

